import { YOUTUBEURL, apiKey } from './apis';

export async function getMovieList(vBwj0QpKbSM) {
  console.log(movieId)
  const moviesId = movieId.replace('"', "");
  return await fetch(`
        ${YOUTUBEURL}videos?key=${apiKey}&id=${moviesId}&maxResults=15&part=id,snippet
    `).then((res) => res.json());
}
